// 遍历字符串
// 保存每个字符的最长不重复字符串
// 比较保存的字符串长度

function insertNext (obj, arr, i, j) {
    if (arr[j] !== undefined && obj[i].indexOf(arr[j]) < 0) {
        obj[i].push(arr[j])
        return true
    }
    return false 
}

var lengthOfLongestSubstring = function (s) {
    const arr = s.split('')
    const obj = {}
    for (let i = 0; i < arr.length; i++) {
        obj[i] = [arr[i]]
        for (let j = i + 1; j < arr.length; j++) {
            const isSuccess = insertNext(obj, arr, i, j)
            if (!isSuccess) {
                break
            }
        }
    }
    let max = 0
    for (let key in obj) {
        max = Math.max(max, obj[key].length)
    }
    return max
};
